void fir::thread_ap_NS_fsm() {
    switch (ap_CS_fsm.read().to_uint64()) {
        case 1 : 
            if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
                ap_NS_fsm = ap_ST_fsm_pp0_stage0;
            } else {
                ap_NS_fsm = ap_ST_fsm_state1;
            }
            break;
        case 2 : 
            if ((!(esl_seteq<1,1,1>(ap_const_logic_1, ap_enable_reg_pp0_iter5.read()) && esl_seteq<1,1,1>(ap_block_pp0_stage0_subdone.read(), ap_const_boolean_0) && esl_seteq<1,1,1>(ap_enable_reg_pp0_iter4.read(), ap_const_logic_0)) && !(esl_seteq<1,1,1>(ap_const_logic_1, ap_enable_reg_pp0_iter0.read()) && esl_seteq<1,1,1>(ap_block_pp0_stage0_subdone.read(), ap_const_boolean_0) && esl_seteq<1,1,1>(ap_const_lv1_1, exitcond_fu_230_p2.read()) && esl_seteq<1,1,1>(ap_enable_reg_pp0_iter1.read(), ap_const_logic_0)))) {
                ap_NS_fsm = ap_ST_fsm_pp0_stage0;
            } else if (((esl_seteq<1,1,1>(ap_const_logic_1, ap_enable_reg_pp0_iter5.read()) && 
  esl_seteq<1,1,1>(ap_block_pp0_stage0_subdone.read(), ap_const_boolean_0) && 
  esl_seteq<1,1,1>(ap_enable_reg_pp0_iter4.read(), ap_const_logic_0)) || (esl_seteq<1,1,1>(ap_const_logic_1, ap_enable_reg_pp0_iter0.read()) && 
  esl_seteq<1,1,1>(ap_block_pp0_stage0_subdone.read(), ap_const_boolean_0) && 
  esl_seteq<1,1,1>(ap_const_lv1_1, exitcond_fu_230_p2.read()) && 
  esl_seteq<1,1,1>(ap_enable_reg_pp0_iter1.read(), ap_const_logic_0)))) {
                ap_NS_fsm = ap_ST_fsm_state8;
            } else {
                ap_NS_fsm = ap_ST_fsm_pp0_stage0;
            }
            break;
        case 4 : 
            if ((esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_data_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_keep_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_strb_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_user_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_last_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_id_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_dest_V_1_state.read()[0]) && esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state8.read()) && !(esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_data_V_1_ack_in.read()) || esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_keep_V_1_ack_in.read()) || esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_strb_V_1_ack_in.read()) || esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_user_V_1_ack_in.read()) || esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_last_V_1_ack_in.read()) || esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_id_V_1_ack_in.read()) || esl_seteq<1,1,1>(ap_const_logic_0, stream_out_V_dest_V_1_ack_in.read())))) {
                ap_NS_fsm = ap_ST_fsm_state1;
            } else {
                ap_NS_fsm = ap_ST_fsm_state8;
            }
            break;
        default : 
            ap_NS_fsm = "XXX";
            break;
    }
}

